import React, { Component } from "react";
import axios from 'axios'

class Fib extends Component {
    state = {
        seenIndexes: [],
        values: {},
        index: ''
    }

    componentDidMount() {
        this.fetchValues()
        this.fetchIndexes()
    }

    fetchValues = async () => {
        console.log('ready to fetch values current')
        const values = await axios.get('/api/values/current')
        console.log('initial fetch values current: ', values)
        this.setState({ values: values.data })
        
    }

    fetchIndexes = async () => {
    //    const seenIndexes = await axios.get('/api/indexes/current')
    // pg data
        const seenIndexes = await axios.get('/api/values/all');

        this.setState({ seenIndexes: seenIndexes.data })
        console.log('seen indexex: ', seenIndexes)
    }

    renderSeenIndexes = () => {
        console.log('length seenindexwes: ', this.state.seenIndexes.length )
        if (this.state.seenIndexes.length < 2) {
            return 'There are no indexes yet'
        }
        return this.state.seenIndexes.map (({number}) => number).join(', ')

        }
    
    renderValues = () => {
        const entries = []
        
        for(let key in this.state.values) {
            console.log('rendering key i calculated: ', this.state.values[key])
            entries.push(
                <div key = {key}>
                    for index { key } I calculated {this.state.values[key]}   
                    
                </div>
            )
        }
        return entries
    }

    handleOnSubmit = async (event) => {
        event.preventDefault()
        console.log('index to post: ', this.state.index)
        await axios.post('/api/values', {
            index: this.state.index,
        })
         console.log('posted: ', this.state.index)
        this.setState({ index:  '' })
    }

    render() {
        return (
            <div>
                <form onSubmit = { this.handleOnSubmit }>
                    <label>Enter your index:</label>
                    <input value= {this.state.index}
                        onChange={( event ) => this.setState({ index: event.target.value })}
                    />
                    <button>Submit</button>
                </form>
                <h3>Indexes I have seen: </h3>
                {this.renderSeenIndexes()}

                <h3>Calculated Values: </h3>
                {this.renderValues()}
            </div>
        )
    }
}

export default Fib
